description:
Billy Connolly's Big Send Off

Sociopolitical Documentary hosted by Billy Connolly, published by ITV in 2014 - English narration


Information
------------------------------

Billy Connolly sets out to gain an insight into the rich variety of attitudes, belief systems, rituals and customs relating to death that are woven into different cultures and communities. Billy's quest takes him inside locations and into the company of people across religious, cultural and social boundaries, to discover, with his trademark charisma and curiosity, what death means to different communities and the diverse ways it is marked. Along the way, Billy also looks into the business of death and candidly shares his thoughts on his own death, how he would like to go, and how he would like to be remembered.

